import {useSpring, animated} from 'react-spring';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';


const steps = [
  {
    id: '0',
    message: 'Welcome to react chatbot!',
    trigger: '1',
  },
  {
    id: '1',
    message: 'Bye!',
    end: true,
  },
];


