          <Container  style={{backgroundColor:"white",  paddingTop: 10, paddingBottom:10}}>
            <div style={{boxShadow: "2px 2px 3px #9999"}}>hello</div>
          </Container>
        </ParallaxLayer>
      </ParallaxLayer>
    </Parallax>
  )

}

